import React from 'react';


class Header extends React.Component {

    render() {
        return <header>
            <h1 className="header-logo non-select" data-name="start" onClick={() => {
                    this.props.ShowProfile();
                }}> 
                <a href="/polls/">MIREA</a>
                <span style={{marginLeft: '-3px'}}>.polls</span>
            </h1>
            <section>
                <button id="profileBtn" className="profile-btn" data-name="profile" onClick={() => {
                    this.props.ShowProfile();
                }}></button>
            </section>
        </header>
    }

}

export { Header }
